        public override RecordType RecordType => Ammo_Registration.AMMO_HEADER;
        protected static void FillBinaryStructs(
            IAmmoInternal item,
            MutagenFrame frame,
            MasterReferences masterReferences)
        {
            ItemAbstractSetterCommon.FillBinaryStructs(
                item: item,
                frame: frame,
                masterReferences: masterReferences);
